    return "<div class=\"close dark\">&times;</div>\n<div class=\"regular-resume\">\n\n  <a class=\"pdf\" href=\"Aaron_Cordova_resume.pdf\" target=\"_blank\">PDF</a>\n\n  <header>\n    <h1>Aaron Cordova</h1>\n    <div class=\"links\">\n      <a target=\"_blank\" href=\"mailto:theqodesmith@gmail.com\">theqodesmith@gmail.com</a>\n      <div class=\"separator\"></div>\n      <a target=\"_blank\" href=\"tel://1-917-524-7817\">917.524.7817</a>\n      <div class=\"separator\"></div>\n      <a target=\"_blank\" href=\"http://github.com/qodesmith\">github.com/qodesmith</a>\n      <div class=\"separator\"></div>\n      <a target=\"_blank\" href=\"http://linkedin.com/in/cordovaaaron\">linkedin.com/in/cordovaaaron</a>\n    </div>\n  </header>\n\n  <section class=\"experience\">\n    <h4>Experience</h4>\n\n    <div>\n      <div><span class=\"bold\">Accenture</span>, New York, NY<span class=\"date\">July 2015 - Present</span></div>\n      <div>Front End Developer</div>\n      <ul>\n        <li>Technology used daily: JavaScript, HTML, CSS, jQuery, LESS, Grunt, GIT</li>\n        <li>Creating pixel-perfect responsive web applications from supplied comps (pdf / psd)</li>\n        <li>Presenting product demonstrations for our national client audience</li>\n        <li>Working in an agile environment with local, national, and global teams</li>\n      </ul>\n    </div>\n\n    <div>\n      <div><span class=\"bold\">General Assembly</span>, New York, NY<span class=\"date\">Sept 2015 - Present</span></div>\n      <div>Instructional Associate</div>\n      <ul>\n        <li>Assist students with lessons, labs, and homework</li>\n        <li>Mentor students as a previous WDI grad & successful developer</li>\n        <li>Courses as an IA:\n          <ul>\n            <li><span class=\"italic\">FEWD: Front End Web Development</span> - a 10-week front end part time course</li>\n            <li><span class=\"italic\">Programming For Non-Programmers</span> - a weekend intro to programming course</li>\n          </ul>\n        </li>\n      </ul>\n    </div>\n  </section>\n\n  <section class=\"personal-projects\">\n    <h4>Personal Projects</h4>\n    <div class=\"project\">\n      <div><span class=\"bold\">Typer.js</span> - <span class=\"italic\">an easy to use, choc-full-of-options, robust automated typing library</span></div>\n      <ul>\n        <li>Automatically type things on the screen including two styles of an optional cursor</li>\n        <li>Various methods allow for real-world typing: back, continue, new line, speed, etc.</li>\n        <li>Built completely using vanilla JavaScript (i.e. no jQuery dependency)</li>\n        <li>Published as an NPM module</li>\n      </ul>\n    </div>\n\n    <div class=\"project\">\n      <div><span class=\"bold\">JAC Sound Factory</span> - <span class=\"italic\">a sample playback application to record & save compositions</span></div>\n      <ul>\n        <li>Implemented a sound engine using the Web Audio API</li>\n        <li>Built a graphical equalizer as the page background with Canvas.js</li>\n        <li>Developed a custom record and playback sequencer with JavaScript</li>\n      </ul>\n    </div>\n\n    <div class=\"project\">\n      <div><span class=\"bold\">Thing-To-HTML</span> - <span class=\"italic\">convert objects and arrays into a collapsible HTML hierarchy</span></div>\n      <ul>\n        <li>Generates a responsive HTML hierarchy from any JavaScript object or array</li>\n        <li>Two CSS themes included: light and dark</li>\n        <li>Published as an NPM module</li>\n      </ul>\n    </div>\n\n    <div class=\"project\">\n      <div><span class=\"bold\">Time Calculator</span> - <span class=\"italic\">a calculator that can add and subtract times in the d:h:m:s format</span></div>\n      <ul>\n        <li>Responsive layout built using Flexbox</li>\n        <li>Random numbers & number sizes generated as the background (for an added math touch)</li>\n      </ul>\n    </div>\n\n    <div class=\"project\">\n      <div><span class=\"bold\">Tetris</span> - <span class=\"italic\">a JavaScript version of the original Tetris game</span></div>\n    </div>\n\n    <div class=\"project\">\n      <div><span class=\"bold\">Background Image Gallery</span> - <span class=\"italic\">smooth full page background gallery for websites with randomization feature</span></div>\n    </div>\n\n    <div class=\"project\">\n      <div><span class=\"bold\">Deck Grid</span> - <span class=\"italic\">interactive graph-paper looking layout of my backyard to help me design a wooden deck</span></div>\n    </div>\n  </section>\n\n  <section class=\"skills\">\n    <h4>Technical Skills</h4>\n    <div>JavaScript, HTML, CSS, Backbone, Express, Node, Flexbox, LESS, Gulp, jQuery, Handlebars, responsive design, PostgreSQL, GIT, Github, Adobe Photoshop, Wordpress</div>\n  </section>\n\n  <section class=\"previous-experience\">\n    <h4>Previous Experience</h4>\n\n    <div class=\"wordpress\">\n      <div><span class=\"bold\">Freelance</span>, New York, NY<span class=\"date\">2010 - 2015</span></div>\n      <div>Wordpress Designer</div>\n      <ul>\n        <li>Customized themes with CSS, Adobe Photoshop, and various plugins</li>\n        <li>Integrated e-commerce solutions (EDD & WooCommerce) and maintained online stores</li>\n        <li>Maintained database and site backups via FTP with CRON jobs</li>\n      </ul>\n      <div class=\"clients\">Clients:</div>\n      <ul>\n        <li>In My City Records</li>\n        <li>And/With Creative</li>\n      </ul>\n    </div>\n\n    <div class=\"nycta\">\n      <div><span class=\"bold\">New York City Transit</span>, New York, NY <span class=\"date\">2005 - 2015</span></div>\n      <div>Track Worker</div>\n    </div>\n  </section>\n\n  <section class=\"education\">\n    <h4>Education</h4>\n\n    <div class=\"bold\">General Assembly <span class=\"date\">Feb 2015 - May 2015</span></div>\n    <ul>\n      <li>12-week Full stack immersive bootcamp program</li>\n      <li>Stack: Backbone, Express, Node, PostgreSQL</li>\n    </ul>\n\n    <div class=\"bold\">Cittone Institute of Technology</div>\n    <ul>\n      <li>Certificate in Computer Networking and Digital Electronics</li>\n    </ul>\n\n    <div class=\"bold\">Institute of Audio Research</div>\n    <ul>\n      <li>Diploma in Digital Audio Recording</li>\n    </ul>\n  </section>\n</div>";
